import React from "react";
import "./Header.css";
const Header = () => {
  return (
    <div className="row navbar_upper">
      <div className="col-sm-12 col-lg-2  col-md-2.4  socials">
        <a>FACEBOOK</a>
      </div>
      <div className="col-sm-12 col-lg-2  col-md-2.4  socials">
        <a>INSTAGRAM</a>
      </div>
      <div className="col-sm-12 col-lg-2  col-md-2.4  socials">
        <a>TELEGRAM</a>
      </div>
      <div className="col-sm-12 col-lg-2  col-md-2.4  socials">
        <a>TWITTER</a>
      </div>
      <div className="col-sm-12 col-lg-2  col-md-2.4  socials">
        <a>GMAIL</a>
      </div>
    </div>
  );
};

export default Header;
